import "./App.css";
import { BrowserRouter as Router } from "react-router-dom";
import Home from "./pages";

function App() {
  const Pic = require("./images/Main.jpg");

  return (
    <Router>
      <Home />
      <img src={Pic} alt="" />
    </Router>
  );
}

export default App;
